def _pixmap_from_b64(b64str):
    from PySide6.QtCore import QByteArray
    from PySide6.QtGui import QImage
    ba = QByteArray.fromBase64(b64str.encode())
    img = QImage()
    img.loadFromData(ba)
    return QPixmap.fromImage(img)


