class ThemeManager(QObject):
    changed = Signal()
    def __init__(self):
        super().__init__()
        self.t = DARK
    def toggle(self):
        self.t = LIGHT if self.t["is_dark"] else DARK
        self.changed.emit()


theme = ThemeManager()


def _pm(size):
    pm = QPixmap(size, size)
    pm.fill(Qt.transparent)
    return pm

def icon_sun(color, size=15):
    pm = _pm(size)
    p = QPainter(pm)
    p.setRenderHint(QPainter.Antialiasing)
    c = QColor(color)
    cx = cy = size / 2
    pen = QPen(c, 1.3, Qt.SolidLine, Qt.RoundCap)
    p.setPen(pen)
    for i in range(8):
        a = math.radians(i * 45)
        p.drawLine(
            QPointF(cx + math.cos(a) * 4.6, cy + math.sin(a) * 4.6),
            QPointF(cx + math.cos(a) * 6.4, cy + math.sin(a) * 6.4),
        )
    p.setBrush(QBrush(c)); p.setPen(Qt.NoPen)
    p.drawEllipse(QRectF(cx - 2.8, cy - 2.8, 5.6, 5.6))
    p.end()
    return QIcon(pm)

def icon_moon(color, size=15):
    pm = _pm(size)
    p = QPainter(pm)
    p.setRenderHint(QPainter.Antialiasing)
    c = QColor(color)
    cx = cy = size / 2
    body = QPainterPath()
    body.addEllipse(QRectF(cx - 4.8, cy - 4.8, 9.6, 9.6))
    cut = QPainterPath()
    cut.addEllipse(QRectF(cx - 1.2, cy - 5.8, 9.6, 9.6))
    p.setBrush(QBrush(c)); p.setPen(Qt.NoPen)
    p.drawPath(body.subtracted(cut))
    p.end()
    return QIcon(pm)

def icon_eye_pixmap(color, size=16):
    pm = _pm(size)
    p = QPainter(pm)
    p.setRenderHint(QPainter.Antialiasing)
    c = QColor(color)
    cx = size / 2
    cy = size / 2
    r = size / 2 - 1.0

    pen_circle = QPen(c, 1.4, Qt.SolidLine, Qt.RoundCap, Qt.RoundJoin)
    p.setPen(pen_circle)
    p.setBrush(Qt.NoBrush)
    p.drawEllipse(QRectF(cx - r, cy - r, r * 2, r * 2))

    # dot
    p.setBrush(QBrush(c))
    p.setPen(Qt.NoPen)
    dot_r = 1.2
    dot_y = cy - r + 2.6
    p.drawEllipse(QRectF(cx - dot_r, dot_y, dot_r * 2, dot_r * 2))

    # stem with a small gap below the dot
    pen_stem = QPen(c, 1.5, Qt.SolidLine, Qt.RoundCap)
    p.setPen(pen_stem)
    p.drawLine(QPointF(cx, dot_y + dot_r * 2 + 1.8), QPointF(cx, cy + r - 2.2))

    p.end()
    return pm

def icon_tab(name, color, size=13):
    pm = _pm(size)
    p = QPainter(pm)
    p.setRenderHint(QPainter.Antialiasing)
    c = QColor(color)
    cx = cy = size / 2

    if name == "dashboard":
        # filled solid house
        p.setBrush(QBrush(c)); p.setPen(Qt.NoPen)
        roof = QPainterPath()
        roof.moveTo(cx, cy - 5.8)
        roof.lineTo(cx - 5.5, cy - 0.5)
        roof.lineTo(cx + 5.5, cy - 0.5)
        roof.closeSubpath()
        p.drawPath(roof)
        p.drawRect(QRectF(cx - 4.2, cy - 0.5, 8.4, 5.8))
        p.setCompositionMode(QPainter.CompositionMode_Clear)
        p.drawRect(QRectF(cx - 1.5, cy + 1.5, 3.0, 3.8))
        p.setCompositionMode(QPainter.CompositionMode_SourceOver)

    elif name == "seeds":
        # minimal sprout: stem + two leaves
        pen = QPen(c, 1.4, Qt.SolidLine, Qt.RoundCap, Qt.RoundJoin)
        p.setPen(pen); p.setBrush(Qt.NoBrush)
        p.drawLine(QPointF(cx, cy + 5.0), QPointF(cx, cy - 2.0))
        path = QPainterPath()
        path.moveTo(cx, cy)
        path.cubicTo(cx, cy - 4.0, cx + 4.5, cy - 4.5, cx + 4.0, cy - 1.0)
        path.lineTo(cx, cy)
        p.drawPath(path)
        path2 = QPainterPath()
        path2.moveTo(cx, cy - 1.5)
        path2.cubicTo(cx, cy - 5.5, cx - 4.5, cy - 5.5, cx - 4.0, cy - 2.5)
        path2.lineTo(cx, cy - 1.5)
        p.drawPath(path2)

    elif name == "tools":
        # wrench
        pen = QPen(c, 1.4, Qt.SolidLine, Qt.RoundCap, Qt.RoundJoin)
        p.setPen(pen); p.setBrush(Qt.NoBrush)
        p.save()
        p.translate(cx, cy)
        p.rotate(-45)
        # handle shaft
        shaft_pen = QPen(c, 2.5, Qt.SolidLine, Qt.RoundCap, Qt.RoundJoin)
        p.setPen(shaft_pen)
        p.drawLine(QPointF(0, 1.5), QPointF(0, 7.5))
        p.setPen(pen)
        # open-end head at top
        head = QPainterPath()
        head.moveTo(-2.8, -2.0)
        head.lineTo(-2.8, -5.5)
        head.cubicTo(-2.8, -8.5, 2.8, -8.5, 2.8, -5.5)
        head.lineTo(2.8, -2.0)
        p.drawPath(head)
        # gap in head (open-end wrench slot)
        p.setPen(QPen(QColor(0, 0, 0, 0), 0))
        p.setBrush(QBrush(c))
        p.drawRect(QRectF(-1.3, -5.2, 2.6, 3.5))
        p.setBrush(Qt.NoBrush)
        p.restore()

    elif name == "settings":
        # outline sliders / equalizer
        pen = QPen(c, 1.3, Qt.SolidLine, Qt.RoundCap, Qt.RoundJoin)
        p.setPen(pen); p.setBrush(Qt.NoBrush)
        for xo, yh in [(-3.8, 2.5), (0.0, 4.0), (3.8, 1.5)]:
            bx = cx + xo
            p.drawLine(QPointF(bx, cy - 5.0), QPointF(bx, cy + 5.0))
            p.setBrush(QBrush(c))
            p.drawEllipse(QRectF(bx - 1.4, cy - yh - 1.4, 2.8, 2.8))
            p.setBrush(Qt.NoBrush)

    p.end()
    return QIcon(pm)


# Toggle switch geometry constants  knob perfectly centered on track
_SW_W      = 40
_SW_H      = 20
_TRACK_H   = 14
_TRACK_Y   = (_SW_H - _TRACK_H) / 2
_KNOB_D    = 18
_KNOB_Y    = (_SW_H - _KNOB_D) / 2
_KNOB_OFF  = 1
_KNOB_TRAV = _SW_W - _KNOB_D - _KNOB_OFF - 2


class ToggleSwitch(QWidget):
    toggled = Signal(bool)

    def __init__(self, parent=None):
        super().__init__(parent)
        self._on = False
        self._anim_pos = 0.0
        self.setFixedSize(_SW_W, _SW_H)

        self._timer = QTimer(self)
        self._timer.setInterval(12)
        self._timer.timeout.connect(self._step)
        theme.changed.connect(self.update)

    def _get_pos(self): return self._anim_pos
    def _set_pos(self, v): self._anim_pos = v; self.update()
    anim_pos = Property(float, _get_pos, _set_pos)

    def _step(self):
        target = 1.0 if self._on else 0.0
        diff = target - self._anim_pos
        if abs(diff) < 0.03:
            self._anim_pos = target
            self._timer.stop()
        else:
            self._anim_pos += diff * 0.22
        self.update()

    def set_on(self, v, animate=True):
        self._on = v
        if animate:
            self._timer.start()
        else:
            self._anim_pos = 1.0 if v else 0.0
            self.update()
        self.toggled.emit(v)

    def is_on(self): return self._on

    def paintEvent(self, _):
        t = theme.t
        p = QPainter(self)
        p.setRenderHint(QPainter.Antialiasing)

        c_off = QColor(t["track_off"])
        c_on  = QColor(t["track_on"])
        a = self._anim_pos
        rv = int(c_off.red()   + (c_on.red()   - c_off.red())   * a)
        gv = int(c_off.green() + (c_on.green() - c_off.green()) * a)
        bv = int(c_off.blue()  + (c_on.blue()  - c_off.blue())  * a)

        # Track spans exactly between the two knob center positions
        # so the knob circle fully covers both end caps  zero bleed possible
        knob_off_cx = _KNOB_OFF + _KNOB_D / 2
        knob_on_cx  = _KNOB_OFF + _KNOB_TRAV + _KNOB_D / 2
        track_x     = knob_off_cx - _TRACK_H / 2
        track_w     = (knob_on_cx + _TRACK_H / 2) - track_x
        track_rect  = QRectF(track_x, _TRACK_Y, track_w, _TRACK_H)
        radius      = _TRACK_H / 2

        p.setPen(Qt.NoPen)
        p.setBrush(QBrush(QColor(rv, gv, bv)))
        p.drawRoundedRect(track_rect, radius, radius)

        knob_x    = _KNOB_OFF + self._anim_pos * _KNOB_TRAV
        knob_rect = QRectF(knob_x, _KNOB_Y, _KNOB_D, _KNOB_D)
        p.setPen(Qt.NoPen)
        p.setBrush(QBrush(QColor(t["knob"])))
        p.drawEllipse(knob_rect)

        outline_color = QColor(0, 0, 0, 130) if t["is_dark"] else QColor(0, 0, 0, 80)
        p.setPen(QPen(outline_color, 1.8))
        p.setBrush(Qt.NoBrush)
        p.drawEllipse(knob_rect.adjusted(0.9, 0.9, -0.9, -0.9))

