class KeyCaptureEdit(QLineEdit):
    key_changed = Signal(str)

    def __init__(self, default="\\", parent=None):
        super().__init__(parent)
        self.setObjectName("keyInput")
        self._value = default
        self.setText(default)
        self.setReadOnly(True)
        self.setFixedSize(52, 24)
        self.setAlignment(Qt.AlignCenter)
        self._listening = False

    def mousePressEvent(self, e):
        self._listening = True; self.setText("..."); self.setFocus()

    def keyPressEvent(self, e):
        if self._listening:
            key = e.key()
            mods = e.modifiers()
            if key == Qt.Key_Escape:
                self.setText(self._value)
                self._listening = False
                e.accept()
                return
            seq = QKeySequence(mods.value | key)
            key_str = seq.toString()
            if key_str:
                self._value = key_str
                self.setText(key_str)
                self.key_changed.emit(key_str)
            self._listening = False
            e.accept()
        else:
            super().keyPressEvent(e)

    def focusOutEvent(self, e):
        if self._listening:
            self._listening = False; self.setText(self._value)
        super().focusOutEvent(e)

    def value(self): return self._value


