                _step(2.5)

                mc.position = (479, 299)
                scroll_end = time.time() + 1.0
                while time.time() < scroll_end:
                    if stop.is_set(): return
                    mc.scroll(0, 1)
                    _step(0.05)

                nav_pynput = _nav_key_pynput()
                kb.press(nav_pynput)
                kb.release(nav_pynput)
                if stop.is_set(): return
                _step(0.3)

                for _ in range(2):
                    kb.press(Key.right)
                    kb.release(Key.right)
